    day: 1,
    hour: 12,
    minute: 0,
    city: 'New York',
    lat: 40.7128,
    lon: -74.0060,
    timezone: 'America/New_York'
  };

  beforeEach(() => {
    vi.clearAllMocks();
  });

  it('renders multi-system chart interface with birth data', () => {
    render(
      <TestWrapper>
        <MultiSystemChartDisplay birthData={mockBirthData} />
