          <li> Use quiet hours to avoid late-night notifications</li>
          <li> Smart Setup analyzes your usage to suggest optimal settings</li>
          <li> Test notifications to ensure they&apos;re working properly</li>
        </ul>
      </div>
    </div>
  );
};

