import axios, { AxiosError } from "axios";
import { useAuth } from "@cosmichub/auth";

export default function SaveChart(): React.ReactNode {
  const { user } = useAuth();
  const [formData, setFormData] = useState({
    year: "",
    month: "",
    day: "",
    hour: "",
    minute: "",
    city: "",
  });
  const [houseSystem, setHouseSystem] = useState("P");
  const [error, setError] = useState<string | null>(null);
  const { toast } = useToast();
  const navigate = useNavigate();

  if (!user) {
    navigate("/login");
    return null;
  }

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>): void => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e: React.FormEvent): Promise<void> => {
    e.preventDefault();
    setError(null);
    try {
      const token = await user.getIdToken();
      await axios.post(
        `${import.meta.env.VITE_BACKEND_URL}/save-chart`,
        {
          year: parseInt(formData.year),
          month: parseInt(formData.month),
          day: parseInt(formData.day),
          hour: parseInt(formData.hour),
          minute: parseInt(formData.minute),
          city: formData.city,
          house_system: houseSystem
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      toast({
        title: "Chart Saved",
        description: "Your natal chart has been saved successfully.",
        status: "success",
        duration: 3000,
        isClosable: true,
      });
      navigate("/saved-charts");
    } catch (error: unknown) {
      const err = error as AxiosError<{detail?: string}>;
      const msg = err.response?.data?.detail ?? "Failed to save chart";
      setError(msg);
      toast({
        title: "Error",
        description: msg,
        status: "error",
        duration: 5000,
        isClosable: true,
      });
    }
  };

  const isFormValid = (): boolean => Object.values(formData).every((v) => v !== "");

  return (
