                ) : (
                  <div>No preset selected</div>
                )}
                <div>Volume: {Math.round(currentSettings.volume)}%</div>
                <div>Duration: {formatDuration(currentSettings.duration)}</div>
              </div>
            </div>

            <div className="flex gap-3">
              <button
                onClick={() => {
                  setShowSaveDialog(false);
                  setNewPresetName('');
                  setNewPresetDescription('');
                }}
                className="flex-1 px-4 py-2 text-gray-700 transition-colors border border-gray-300 rounded-lg hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-gray-500 focus:ring-offset-2 disabled:opacity-50"
                disabled={loading}
              >
                Cancel
              </button>
              <button
                onClick={handleSavePreset}
                className="flex-1 px-4 py-2 text-white transition-colors bg-blue-600 rounded-lg hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 disabled:opacity-50"
                disabled={loading || !newPresetName.trim()}
                aria-describedby="save-button-help"
              >
                {loading ? 'Saving...' : 'Save Preset'}
              </button>
              <div id="save-button-help" className="sr-only">
                {!newPresetName.trim() ? 'Enter a preset name to enable saving' : 'Save your current settings as a new preset'}
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
});

PresetSelector.displayName = 'PresetSelector';

export default PresetSelector;

import React, { useState } from 'react';
import { HEALWAVE_TIERS, calculateYearlySavings, type HealwaveSubscriptionTier } from '@cosmichub/subscriptions';
import { useAuth } from '@cosmichub/auth';
import * as SwitchPrimitive from '@radix-ui/react-switch';

const PricingPage: React.FC = () => {
  const [isYearly, setIsYearly] = useState(false);
  const { user } = useAuth();

  const handleSubscribe = async (tierSlug: string) => {
    if (user === null || user === undefined) {
      alert('Please sign in to subscribe to HealWave Pro');
      return;
    }

    if (tierSlug === 'free') {
      alert('You are already using the free tier!');
      return;
    }

    alert('Subscription system will be available soon!');
  };

  return (
    <div className="py-16 bg-gray-50 dark:bg-gray-900">
      <div className="container px-4 mx-auto max-w-7xl">
        <div className="flex flex-col items-center mb-12 space-y-8 text-center">
          <h2 className="text-3xl font-bold text-purple-600">
            Choose Your HealWave Plan
          </h2>
          <p className="max-w-2xl text-xl text-gray-600">
            Unlock your mind's potential with therapeutic binaural beats. 
            Start free, upgrade for advanced features.
          </p>

          <div className="flex items-center space-x-4">
            <span className="font-semibold">Monthly</span>
            <SwitchPrimitive.Root
              checked={isYearly}
              onCheckedChange={setIsYearly}
              className="w-11 h-6 bg-gray-200 rounded-full relative data-[state=checked]:bg-purple-600 outline-none cursor-pointer transition-colors"
              aria-label="Toggle yearly billing"
            >
              <SwitchPrimitive.Thumb
                className="block w-5 h-5 bg-white rounded-full shadow-md transform translate-x-0.5 data-[state=checked]:translate-x-5.5 transition-transform"
              />
            </SwitchPrimitive.Root>
            <span className="font-semibold">Yearly</span>
            <span className="px-2 py-1 text-sm font-medium text-white bg-green-500 rounded-md">
              Save up to 33%
            </span>
          </div>
        </div>

        <div className="grid grid-cols-1 gap-8 lg:grid-cols-3">
          {Object.entries(HEALWAVE_TIERS).map(([tierSlug, tier]: [string, HealwaveSubscriptionTier]) => {
            const price = isYearly ? tier.price.yearly : tier.price.monthly;
            const yearlyPrice = tier.price.yearly;
            const monthlyPrice = tier.price.monthly;
            const savings = calculateYearlySavings(monthlyPrice, yearlyPrice);
            const isPopular = tierSlug === 'premium';

            return (
              <div
                key={tierSlug}
                className={`bg-white dark:bg-gray-800 shadow-lg rounded-lg border ${isPopular ? 'border-purple-500 border-4' : 'border-gray-200'} relative transition-all duration-300 ${isPopular ? 'scale-105' : 'scale-100'}`}
              >
                {isPopular === true && (
                  <span className="absolute flex items-center px-4 py-1 space-x-1 text-sm font-medium text-white transform -translate-x-1/2 bg-purple-500 rounded-full -top-3 left-1/2">
                    <span></span>
                    <span>Most Popular</span>
                  </span>
                )}

                <div className="flex flex-col items-center p-8 space-y-6">
                  <div className="space-y-2 text-center">
                    <h3 className={`text-xl font-bold ${isPopular ? 'text-purple-600' : 'text-gray-700 dark:text-gray-300'}`}>
                      {tier.name}
                    </h3>

                    <div className="flex items-baseline justify-center">
                      <span className={`text-4xl font-bold ${isPopular ? 'text-purple-600' : 'text-gray-900 dark:text-white'}`}>
                        ${price}
                      </span>
                      {tierSlug !== 'free' && (
                        <span className="ml-1 text-gray-500">
                          /{isYearly ? 'year' : 'month'}
                        </span>
                      )}
                    </div>

                    {isYearly === true && tierSlug !== 'free' && typeof savings === 'number' && savings > 0 && (
                      <p className="text-sm font-semibold text-green-500">
                        Save {savings}% yearly
                      </p>
                    )}
                  </div>

                  <ul className="w-full space-y-3">
                    {tier.features.map((feature, index) => (
                      <li key={index} className="flex items-center">
                        <span className="mr-2 text-green-500"></span>
                        <span className="text-sm text-gray-700 dark:text-gray-300">{feature}</span>
                      </li>
                    ))}
                  </ul>

                  <button
                    onClick={() => handleSubscribe(tierSlug)}
                    disabled={tierSlug === 'free'}
                    className={`w-full py-3 px-4 rounded-lg font-semibold text-lg transition-all duration-200 ${
                      tierSlug === 'free'
                        ? 'border border-gray-300 text-gray-500 cursor-not-allowed'
                        : 'bg-purple-600 text-white hover:bg-purple-700 hover:shadow-lg'
                    }`}
                    aria-label={`Subscribe to ${tier.name} plan`}
                  >
                    {tierSlug === 'free' ? 'Current Plan' : `Start ${tier.name}`}
                  </button>
                </div>
              </div>
            );
          })}
        </div>

        <div className="flex flex-col items-center mt-16 space-y-4 text-center">
          <p className="text-gray-600">
            All plans include our 7-day free trial. Cancel anytime.
          </p>
          <p className="text-sm text-gray-500">
            Prices in USD. Auto-renewal can be turned off at any time.
          </p>
        </div>
      </div>
    </div>
  );
};

export default PricingPage;

import { useState, type FC, type FormEvent, type ChangeEvent } from 'react';
import { signUp, useAuth } from '@cosmichub/auth';
import { getFirestore, doc, setDoc } from 'firebase/firestore';

interface SignupProps {
  onSwitchToLogin?: () => void;
  onClose?: () => void;
}

interface NotificationPreferences {
  sessionReminders: boolean;
  weeklyProgress: boolean;
  newFrequencies: boolean;
  healthTips: boolean;
}

interface UserProfile {
  email: string;
  firstName: string;
  lastName: string;
  fullName: string;
  dateOfBirth: string | null;
  occupation: string | null;
  experienceLevel: string | null;
  primaryGoals: string | null;
  healthConditions: string | null;
  meditationExperience: string | null;
  preferredSessionLength: string | null;
  notificationPreferences: NotificationPreferences;
  createdAt: string;
  lastLoginAt: string;
  profileCompleted: boolean;
  privacyConsentGiven: boolean;
  privacyConsentDate: string;
  healthDisclaimerAccepted: boolean;
  healthDisclaimerDate: string;
  signupSource: string;
  hasCompletedOnboarding: boolean;
  totalSessionsCompleted: number;
  totalListeningMinutes: number;
  favoriteFrequencies: string[];
  lastActiveAt: string;
  moodTrackingEnabled: boolean;
  progressTrackingEnabled: boolean;
  reminderSettings: {
    enabled: boolean;
    frequency: string;
    preferredTime: string;
  };
}

const Signup: FC<SignupProps> = ({ onSwitchToLogin, onClose }) => {
  // Basic account fields
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  // User profile fields
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [dateOfBirth, setDateOfBirth] = useState('');
  const [occupation, setOccupation] = useState('');
  const [experienceLevel, setExperienceLevel] = useState('');
  const [primaryGoals, setPrimaryGoals] = useState('');
  const [healthConditions, setHealthConditions] = useState('');
  const [meditationExperience, setMeditationExperience] = useState('');
  const [preferredSessionLength, setPreferredSessionLength] = useState('');
  const [notificationPreferences, setNotificationPreferences] = useState({
    sessionReminders: false,
    weeklyProgress: false,
    newFrequencies: false,
    healthTips: false
  });
  const [privacyConsent, setPrivacyConsent] = useState(false);
  const [healthDisclaimer, setHealthDisclaimer] = useState(false);

  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const { user } = useAuth();

  // If user is already logged in, show success message
  if (user) {
    return (
      <div className="text-center">
        <div className="mb-4 text-xl text-green-400"> Already logged in!</div>
        <p className="mb-4 text-gray-300">Welcome, {user.email}</p>
        <button
          onClick={onClose}
          className="px-6 py-2 text-white transition-colors bg-purple-500 rounded-lg hover:bg-purple-600"
        >
          Continue
        </button>
      </div>
    );
  }

  const handleSubmit = async (e: FormEvent<HTMLFormElement>): Promise<void> => {
    e.preventDefault();
    setError('');

    // Enhanced validation
    if (!firstName.trim() || !lastName.trim()) {
      setError('Please enter your first and last name');
      return;
    }

    if (password !== confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    if (password.length < 6) {
      setError('Password must be at least 6 characters long');
      return;
    }

    if (!privacyConsent) {
      setError('Please accept the privacy policy to continue');
      return;
    }

    if (!healthDisclaimer) {
      setError('Please acknowledge the health disclaimer to continue');
      return;
    }

    setIsLoading(true);

    try {
      const user = await signUp(email, password);
      const db = getFirestore();

      // Create comprehensive user profile
      const userProfile: UserProfile = {
        // Basic info
        email: user.email || '',
        firstName: firstName.trim(),
        lastName: lastName.trim(),
        fullName: `${firstName.trim()} ${lastName.trim()}`,

        // Personal information
        dateOfBirth: dateOfBirth || null,
        occupation: occupation.trim() || null,

        // Healing and wellness background
        experienceLevel: experienceLevel || null,
        primaryGoals: primaryGoals.trim() || null,
        healthConditions: healthConditions.trim() || null,
        meditationExperience: meditationExperience || null,
        preferredSessionLength: preferredSessionLength || null,

        // Notification preferences
        notificationPreferences: {
          sessionReminders: notificationPreferences.sessionReminders,
          weeklyProgress: notificationPreferences.weeklyProgress,
          newFrequencies: notificationPreferences.newFrequencies,
          healthTips: notificationPreferences.healthTips
        },

        // Account metadata
        createdAt: new Date().toISOString(),
        lastLoginAt: new Date().toISOString(),
        profileCompleted: !!(firstName && lastName && experienceLevel),
        privacyConsentGiven: true,
        privacyConsentDate: new Date().toISOString(),
        healthDisclaimerAccepted: true,
        healthDisclaimerDate: new Date().toISOString(),

        // Usage analytics
        signupSource: 'web',
        hasCompletedOnboarding: false,
        totalSessionsCompleted: 0,
        totalListeningMinutes: 0,
        favoriteFrequencies: [],
        lastActiveAt: new Date().toISOString(),

        // Wellness tracking
        moodTrackingEnabled: false,
        progressTrackingEnabled: true,
        reminderSettings: {
          enabled: notificationPreferences.sessionReminders,
          frequency: 'daily',
          preferredTime: '19:00'
        }
      };

      await setDoc(doc(db, 'users', user.uid), userProfile);
      onClose?.();
    } catch (error) {
      setError(error instanceof Error ? error.message : 'Signup failed');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="max-w-2xl mx-auto max-h-[90vh] overflow-y-auto">
      <div className="p-8 border shadow-2xl bg-gradient-to-br from-purple-900/50 to-blue-900/50 backdrop-blur-md rounded-2xl border-purple-500/20">
        <div className="mb-8 text-center">
          <div className="mb-4 text-4xl"></div>
          <h2 className="mb-2 text-2xl font-bold text-white">Join HealWave</h2>
          <p className="text-gray-300">Create your account for personalized sound healing</p>
        </div>

        {error && (
          <div className="p-3 mb-6 border rounded-lg bg-red-500/20 border-red-500/50">
            <p className="text-sm text-red-200">{error}</p>
          </div>
        )}

        <form onSubmit={handleSubmit} className="space-y-6">
          {/* Account Details */}
          <div className="grid grid-cols-1 gap-6 md:grid-cols-2">
            <div>
              <label htmlFor="firstName" className="block mb-2 text-sm font-medium text-gray-200">
                First Name *
              </label>
              <input
                type="text"
                id="firstName"
                value={firstName}
                onChange={(e: ChangeEvent<HTMLInputElement>) => setFirstName(e.target.value)}
                required
                aria-required="true"
                className="w-full px-4 py-3 text-white placeholder-gray-400 transition-all border rounded-lg bg-white/10 border-purple-500/30 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
                placeholder="Your first name"
                aria-label="First Name"
              />
            </div>

            <div>
              <label htmlFor="lastName" className="block mb-2 text-sm font-medium text-gray-200">
                Last Name *
              </label>
              <input
                type="text"
                id="lastName"
                value={lastName}
                onChange={(e: ChangeEvent<HTMLInputElement>) => setLastName(e.target.value)}
                required
                aria-required="true"
                className="w-full px-4 py-3 text-white placeholder-gray-400 transition-all border rounded-lg bg-white/10 border-purple-500/30 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
                placeholder="Your last name"
                aria-label="Last Name"
              />
            </div>
          </div>

          <div>
            <label htmlFor="email" className="block mb-2 text-sm font-medium text-gray-200">
              Email Address *
            </label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e: ChangeEvent<HTMLInputElement>) => setEmail(e.target.value)}
              required
              aria-required="true"
              className="w-full px-4 py-3 text-white placeholder-gray-400 transition-all border rounded-lg bg-white/10 border-purple-500/30 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
              placeholder="your@email.com"
              aria-label="Email Address"
            />
          </div>

          <div className="grid grid-cols-1 gap-6 md:grid-cols-2">
            <div>
              <label htmlFor="password" className="block mb-2 text-sm font-medium text-gray-200">
                Password *
              </label>
              <input
                type="password"
                id="password"
